import React from "react";
import { Navbar } from "react-bootstrap";

const Footer = () => {
  return (
    <Navbar sticky="bottom" style={{ backgroundColor: "#eee" }}>
      <h1>Navbar</h1>
    </Navbar>
  );
};

export default Footer;
